import React, { Component } from 'react';
import './App.css';
import { MDBInput, MDBCol } from 'mdbreact';


class FruitsPage extends Component {

    constructor(props) {
        super(props);
        this.state = {
            fruitsData: [],
            submittedSearch: false
        }
    }



    render() {
        return (
            <div>
                Hello World
                <MDBCol md="6">
                    <MDBInput hint="Search" type="text" containerClass="mt-0" />
                </MDBCol>
            </div>
        )
    }
}

export default FruitsPage;
